export const Wrapper = styled.main`
  background-color: #06092b;
  color: #fff;
  width: 100%;
  height: 100%;
`

export const Logo = styled.img``

export const Title = styled.h1``

export const Description = styled.h2``

export const Illustration = styled.img``
